import { useSelector, useDispatch } from 'react-redux';
import { useEffect, useState } from 'react';
import Header from '../header';
import CardsList from '../cards-list';
import { Pagination } from 'antd';
import { Routes, Route, Link} from 'react-router-dom'

import './app.scss';

function App() {
    return(
        <div className='body'>
            <header className='header'>
                <Link to={'/'} className='blog-name'>Realworld Blog</Link>
                <div className='header-user-information'>
                    <span className='sing-in-button'>Sign In</span>
                    <button className='button-sing-up'>Sign Up</button>
                </div>

            </header>
            <div className='body-items'>
                <CardsList />
                <Pagination defaultCurrent={1} total={50} className='body-items__pagination'/>
            </div>

        </div>
    )
}

export default App;
